		function updateRoomText(){
		  // Jump to the keyframe representing the current room.
		  _this.gotoAndStop(currentRound);
		  
		  _this.ROOM.font = "120px 'VT323', monospace";
		  _this.ROOM.text = "" + currentRound;
		  var oy = _this.ROOM.y;
		  _this.ROOM.alpha = 0;
		  _this.ROOM.y = oy + 10;
		  createjs.Tween.get(_this.ROOM)
		    .to({alpha:1, y:oy}, 800, createjs.Ease.quadOut);
		}
		
		/**
		 * Returns the cumulative chance (in %) of being in the given round:
		 * - Room 1 always 100%.
		 * - Room 2 also always 100%.
		 * - For rounds >= 3 and <= 10, each additional room multiplies by 2/3.
		 * - For rounds > 10, after room 10 each additional room multiplies by 1/2.
		 */
		function calculateOdds(round) {
		  // Room 1 is guaranteed.
		  if (round === 1) return 100;
		  // Room 2 is also guaranteed (transition 1→2 has no fail).
		  if (round === 2) return 100;
		  
		  var odds = 1;
		  // Start from room 3 all the way to 'round'
		  for (var r = 3; r <= round; r++) {
		    if (r <= 10) {
		      odds *= (2/3);
		    } else {
		      odds *= (1/2);
		    }
		  }
		  return odds * 100;
		}
		
		function updateHUD(){
		  _this.ODDS.font = "80px 'VT323', monospace";
		  _this.APEX.font = "60px 'VT323', monospace";
		  _this.TRY.font = "60px 'VT323', monospace";  // TRY will now display the shards (death count)
		  _this.RECORD.font = "50px 'VT323', monospace";
		  
		  var newOdds = calculateOdds(currentRound);
		  var oddsObj = {value: currentOddsValue};
		  
		  createjs.Tween.get(oddsObj)
		    .to({value: newOdds}, 1000, createjs.Ease.quadOut)
		    .addEventListener("change", () => {
		      _this.ODDS.text = oddsObj.value.toFixed(2) + "%";
		    });
		  currentOddsValue = newOdds;
		  
		  _this.APEX.text = "Room " + currentRound;
		  // Updated: Display the shards (death currency) instead of tries
		  _this.TRY.text = "" + shards;
		  _this.RECORD.text = "Furthest Point Reached: Room " + bestRound;
		  
		  updatePortrait();
		  updateMeter();
		  updateHeartStatus();
		}
		
		// ------------------------------------------------
		// FIXED: Portrait always matches title1→frame1,... 
		// ------------------------------------------------
		function updatePortrait(){
		  // We loop backwards from 9 down to 1.
		  // As soon as we find a threshold the current round satisfies,
		  // we jump to that frame number and stop checking.
		  for (var i = 9; i >= 1; i--){
		    var titleField = _this["title" + i];
		    if (titleField) {
		      var threshold = Number(titleField.text);
		      // If threshold is a valid number and currentRound >= that threshold:
		      if(!isNaN(threshold) && currentRound >= threshold){
		        _this.portrait.gotoAndStop(i); 
		        return;
		      }
		    }
		  }
		  // If none of the thresholds were met, default to frame 1
		  _this.portrait.gotoAndStop(1);
		}
		
		// -------------------------------------
		// METER LOGIC
		// -------------------------------------
		function updateMeter(){
		  // Build milestones dynamically:
		  // Start with room 1, then read from dynamic text fields on stage (milestone1 through milestone9).
		  var meterMilestones = [1];
		  for (var i = 1; i <= 9; i++){
		    var milestoneField = _this["milestone" + i];
		    if(milestoneField){
		      var milestoneValue = Number(milestoneField.text);
		      if(!isNaN(milestoneValue)){
		         meterMilestones.push(milestoneValue);
		      }
		    }
		  }
		  
		  // Find previous and next milestone relative to currentRound.
		  var prevMilestone = meterMilestones[0];
		  var nextMilestone = meterMilestones[meterMilestones.length - 1];
		  for (var i = 0; i < meterMilestones.length; i++) {
		    if(currentRound >= meterMilestones[i]){
		      prevMilestone = meterMilestones[i];
		    } else {
		      nextMilestone = meterMilestones[i];
		      break;
		    }
		  }
		  
		  // If currentRound is exactly a milestone (except room 1), force full meter and award heart
		  if(meterMilestones.includes(currentRound) && currentRound !== meterMilestones[0]){
		    if(currentRound > lastMilestoneRound){
		      isProcessing = true;
		      _this.meter.gotoAndStop(_this.meter.totalFrames - 1);
		      createjs.Tween.get(_this.meter)
		        .to({alpha:0}, 200)
		        .to({alpha:1}, 200)
		        .to({alpha:0}, 200)
		        .to({alpha:1}, 200)
		        .call(() => {
		           heartsCount++;
		           lastMilestoneRound = currentRound;
		           // Reset meter progress to 0 (assumed frame 1)
		           currentMeterProgress = 0;
		           _this.meter.gotoAndStop(1);
		           updateHeartStatus();
		           isProcessing = false;
		        });
		      return;
		    } else {
		      // Already awarded for this milestone, just keep meter full
		      _this.meter.gotoAndStop(_this.meter.totalFrames - 1);
		      return;
		    }
		  }
		  
		  // If beyond the last milestone, keep the meter full
		  if(currentRound > meterMilestones[meterMilestones.length - 1]){
		    _this.meter.gotoAndStop(_this.meter.totalFrames - 1);
		    return;
		  }
		  
		  // Otherwise, interpolate meter progress
		  var range = nextMilestone - prevMilestone;
		  var progress = (currentRound - prevMilestone) / range;
		  
		  var meterObj = {value: currentMeterProgress};
		  createjs.Tween.get(meterObj, {override:true})
		    .to({value: progress}, 1000, createjs.Ease.cubicOut)
		    .addEventListener("change", () => {
		      var tf = Math.round(meterObj.value * (_this.meter.totalFrames - 1)) + 1;
		      _this.meter.gotoAndStop(tf);
		    });
		  currentMeterProgress = progress;
		}
		
		// -------------------------------------
		// HEART LOGIC
		// -------------------------------------
		function updateHeartStatus(){
		  if(heartsCount > 0 && heartState === "NOHEART"){
		    setHeartState("INTRO");
		  } else if(heartsCount === 0 && (heartState === "IDLE" || heartState === "INTRO")){
		    setHeartState("END");
		  }
		}
		
		// -------------------------------------
		// FADE, VIBRATION, AND COLOR FILTER UTILS
		// -------------------------------------
		function fadeOutChests(cb){
		  chestInstances.forEach((c, i) => {
		    var tw = createjs.Tween.get(c).wait(i * 200).to({alpha:0}, 800, createjs.Ease.quadOut);
		    if(i === chestInstances.length - 1) tw.call(cb);
		  });
		}
		
		function removeChests(){
		  chestInstances.forEach(c => {
		    if(c.parent) c.parent.removeChild(c);
		  });
		  chestInstances = [];
		}
		
		function animateVibration(mc){
		  var ox = mc.x;
		  createjs.Tween.get(mc)
		    .to({x:ox - 5}, 50)
		    .to({x:ox + 5}, 50)
		    .to({x:ox - 5}, 50)
		    .to({x:ox + 5}, 50)
		    .to({x:ox}, 50);
		}
		
		function applyColorFilter(mc, r, g, b){
		  var cf = new createjs.ColorFilter(0, 0, 0, 1, r, g, b, 0);
		  mc.filters = [cf];
		  var bnds = mc.getBounds() || mc.nominalBounds;
		  if(bnds) {
		    mc.cache(bnds.x, bnds.y, bnds.width, bnds.height);
		  } else {
		    mc.cache(0, 0, 100, 100);
		  }
		}
		
		// -------------------------------------
		// GAME OVER
		// -------------------------------------
		function showGameOver(){
		  hasGameOverReset = false;
		  _this.gameover.gotoAndStop(0);
		  _this.gameover.gotoAndPlay(0);
		  if(_this.contains(_this.gameover)) _this.removeChild(_this.gameover);
		  _this.addChild(_this.gameover);
		  _this.setChildIndex(_this.gameover, _this.numChildren - 1);
		  _this.gameover.addEventListener("tick", gameOverTickHandler);
		}
		
		function gameOverTickHandler(){
		  // Wait until the gameover animation fully completes before resetting game state.
		  if(_this.gameover.currentFrame >= _this.gameover.totalFrames - 1){
		      currentRound = 1;
		      // Increment shards (death currency) on game over.
		      shards++;
		      // If you were previously using "tries" to count deaths, you can remove or repurpose it.
		      // tries++;  <-- This line is removed/replaced
		      // Reset hearts and milestone tracker for the new game
		      heartsCount = 0;
		      lastMilestoneRound = 0;
		      setHeartState("NOHEART");
		      updateRoomText();
		      updateHUD();
		      placeChests();
		      _this.gameover.stop();
		      _this.removeChild(_this.gameover);
		      _this.gameover.removeEventListener("tick", gameOverTickHandler);
		      isProcessing = false;
		  }
		}
		
