		// -------------------------------------
		if (_this.hintro && _this.hintro.parent) _this.hintro.parent.removeChild(_this.hintro);
		if (_this.hidle && _this.hidle.parent) _this.hidle.parent.removeChild(_this.hidle);
		if (_this.hend && _this.hend.parent) _this.hend.parent.removeChild(_this.hend);
		
		setHeartState("NOHEART"); // ensure NOHEART at game start
		
		function setHeartState(newState) {
		  removeHeartSymbols(); // remove any existing heart symbol from stage
		  heartState = newState;
		  switch (newState) {
		    case "NOHEART":
		      // No heart visible
		      break;
		    case "INTRO":
		      if (!_this.hintro.parent) _this.addChild(_this.hintro);
		      _this.hintro.gotoAndPlay(0);  // Start INTRO from frame 0
		      break;
		    case "IDLE":
		      if (!_this.hidle.parent) _this.addChild(_this.hidle);
		      _this.hidle.gotoAndPlay(0);  // Start IDLE (loop)
		      break;
		    case "END":
		      if (!_this.hend.parent) _this.addChild(_this.hend);
		      _this.hend.gotoAndPlay(0);   // Start END from frame 0
		      break;
		  }
		}
		
		function removeHeartSymbols() {
		  if (_this.hintro && _this.hintro.parent) _this.hintro.parent.removeChild(_this.hintro);
		  if (_this.hidle && _this.hidle.parent) _this.hidle.parent.removeChild(_this.hidle);
		  if (_this.hend && _this.hend.parent) _this.hend.parent.removeChild(_this.hend);
		}
		
		createjs.Ticker.addEventListener("tick", heartTickHandler);
		function heartTickHandler() {
		  switch (heartState) {
		    case "INTRO":
		      if (_this.hintro.currentFrame >= _this.hintro.totalFrames - 1) {
		        setHeartState("IDLE");
		      }
		      break;
		    case "IDLE":
		      // IDLE symbol loops automatically.
		      break;
		    case "END":
		      if (_this.hend.currentFrame >= _this.hend.totalFrames - 1) {
		        setHeartState("NOHEART");
		      }
		      break;
		  }
		}
		
		function playerGainsHeart() {
		  if (heartState === "NOHEART") {
		    setHeartState("INTRO"); // INTRO then transitions to IDLE
		  }
		}
		
		function playerLosesHeart() {
		  if (heartState === "IDLE" || heartState === "INTRO") {
		    setHeartState("END"); // END plays once, then removes the heart
		  }
		}
		
